import React from 'react';
import './content_signup.css';
import RegDetails from './RegDetails';
import BusDetails from './BusDetails';



class ContentSignUp extends React.Component{
  render(){
    return(
      <div className="container" id="SignupContent">
       <p>Fill in your personal details</p>
       <div className="col-6 text-center ml-4">
         <span>Regular Customer</span>
      </div>
         <div className="col-6" id="multiCollapse1">
          {RegDetails.map((items)=>{
            return(
                    <div className={items.classN}>
                      <label for={items.for} class={items.labelC}>{items.name}</label>
                      <input className={items.inputC} type={items.type}/>
                    </div>

            )})}
          </div>
             <button className="btn mt-5 ml-5" type="button" data-toggle="collapse" data-target=".multi-collapse"  aria-controls="multiCollapse2">Business Customer</button>
          <div className="collapse multi-collapse col-6" id="multiCollapse2">
            {BusDetails.map((items)=>{
              return(
                  <div className={items.classN}>
                    <label for={items.for} class={items.labelC}>{items.name}</label>
                    <input className={items.inputC} type={items.type}/>
                  </div>
                )})}
          </div>
      </div>
      )
  }
}
export default ContentSignUp
